import React from 'react';
import logo1 from './logo_oficial.png'; // relative path to image 
import './App.css';
import Card from './componentes/Card';
import Boton from './componentes/BtnLink';
import MyParallax from './parallax';
import MyParallax2 from './SecondParallax';


function App() {
  return (
    <div className="App">
      <div className="nav"> 
        <div className="log">
          <a href="...">
            <img src={logo1} className="logo" alt="logo" width="45px" height="45px" />
            lue Shopping
          </a>
        </div>
        <div className="btns">
          <Boton name="Tienda" />
          <Boton name="Registrate" />
          <Boton name="Iniciar sesion" />
        </div>
      </div>
      <div className="parallax">
         <MyParallax />
      </div>
      <div className="card">
        <Card />
      </div> 
      <div >
        <MyParallax2 />
      </div>    
    </div>

  );
}
export default App;
